انهدام تیم تروریستی در جنوب کشور

🔹یک تیم مسلح که قصد انجام اقدامات تروریستی در جنوب شرق کشور را داشت، توسط قرارگاه قدس نیروی زمینی سپاه شناسایی و قبل از هر اقدامی منهدم شد.
@Farsna

♦️انهدام یک تیم تروریستی توسط سپاه

🔹یک تیم مسلح که قصد انجام اقدامات تروریستی در جنوب شرق کشور را داشت ؛توسط رزمندگان واحدهای اطلاعاتی و عملیاتی قرارگاه قدس نیروی زمینی سپاه در جنوب استان رهگیری و شناسایی و قبل از هر اقدامی منهدم شد.
