♦️عرضه دیگنیتی در بورس لغو شود

🔹معاون وزارت صنعت: عرضه‌کنندگان خودرو مکلفند محصولات تولیدی خود را فقط از طریق سامانه یکپارچه فروش خودرو عرضه کنند و بر این اساس عرضه ۶۰۰ دستگاه دیگنیتی پرستیژ از سوی این خودروساز در بورس کالا باید لغو شود.
